import React, { useState,useContext } from 'react';
import { UserContext } from '../UserContext';
import './Login.css';

function Login() {
  const msg = useContext(UserContext)
  return (
    <div className='card'>
        <h1> Login {msg}</h1>
        <div className='textbox'>
            <input type='text' placehorder="Username"></input>
        </div>
        <div className='textbox'>
            <input type='password' placehorder="Password"></input>
        </div>     
        <button>Login</button>
        
            
    </div>
  );
}

export default Login;
